package com.whitemind.cogit.code.controller;import com.whitemind.cogit.auth.service.GithubService;import lombok.RequiredArgsConstructor;import lombok.extern.slf4j.Slf4j;import org.springframework.http.HttpStatus;import org.springframework.http.ResponseEntity;import org.springframework.web.bind.annotation.PostMapping;import org.springframework.web.bind.annotation.RequestBody;import org.springframework.web.bind.annotation.RequestMapping;import org.springframework.web.bind.annotation.RestController;import com.whitemind.cogit.code.dto.request.CodeRequest;import javax.servlet.http.HttpServletRequest;@Slf4j@RestController@RequiredArgsConstructor@RequestMapping("/code")public class CodeController {	private final GithubService githubService;	@PostMapping	public ResponseEntity<Void> testCode(@RequestBody CodeRequest code, HttpServletRequest request) throws Exception {		System.out.println(code.getCodeContent());		System.out.println(code.getCodeResult());		System.out.println(code.getCodeLanguage());		System.out.println(code.getCodeRunningTime());		System.out.println(code.getAlgorithmQuestId());		System.out.println(code.getAlgorithmQuestId());		githubService.uploadGitCode(code, request);		return ResponseEntity.status(HttpStatus.OK).build();	}}